import MiContext from './Context';
import {useState} from 'react';

function Provider(props) {
    const [misiion, setMisiion] = useState({
        mname: "Go to Russia",
        agent: "007",
        accept: "Not accepted"
    })
    return(
        <MiContext.Provider value={{
            data: misiion
        }}>
            {props.children}
        </MiContext.Provider>
    )
}

export default Provider;
